import React from "react";

class PropsInClassComponent extends React.Component {
    // constructor(props) {

    // }
    render() {
        return (
            <>  
                <h1></h1>
                <h3>YOE:{this.props.yoe}</h3>
                <h3>Salary:{this.props.salary}</h3>
            </>
        )
    }
}

export default PropsInClassComponent;
